import React, { Component } from 'react';
import axios from 'axios';

export class About extends Component {
   constructor(){
       super();
       this.state = {
           admins: []
       }
   }
    componentDidMount(){
        axios.get('/api/admins').then( response => {
            this.setState({
                admins: response.data
            })
        })
    }
  render() {
    return (
      <div>
        About
      </div>
    )
  }
}

export default About
